import "./ExpenseItem.css";

const ExpenseItem = () => {
  return (
    <div className="expense-item">
      <div >March 28th 2020</div>
      <div className="expense-item__description">Car Insurance</div>
      <div className="expense-item__price">297.54</div>
    </div>
  );
};

export default ExpenseItem;
